import React, { useState, useEffect } from "react";
import desam from "../img/desam.png";
import { Link, useLocation } from "react-router-dom";
import { FaBars, FaTimes, FaMoon, FaSun } from "react-icons/fa";
import { animateScroll as scroll } from "react-scroll";

const InnerHeader = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isSticky, setIsSticky] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  const location = useLocation();
  const splitLocation = location.pathname.split("/");

  const toTop = () => {
    scroll.scrollToTop({ duration: 0 });
    setIsOpen(false);
  };

  // Sticky effect
  useEffect(() => {
    const handleScroll = () => {
      setIsSticky(window.scrollY > 80);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  // Close menu on route change
  useEffect(() => {
    setIsOpen(false);
  }, [location]);

  return (
    <header
      style={{
        ...styles.header,
        ...(isSticky ? styles.sticky : {}),
        ...(darkMode ? styles.dark : {})
      }}
    >
      <div style={styles.container}>
        
        {/* Logo */}
        <Link to="/" onClick={toTop}>
          <img
            src={desam}
            alt="DESAM"
            style={{ maxWidth: "150px", maxHeight: "50px" }}
          />
        </Link>

        {/* Desktop Menu */}
        <nav style={styles.desktopNav}>
          {navItems.map((item) => (
            <Link
              key={item.path}
              to={item.path}
              style={{
                ...styles.link,
                ...(splitLocation[1] === item.path.replace("/", "")
                  ? styles.active
                  : {})
              }}
            >
              {item.label}
            </Link>
          ))}
        </nav>

        {/* Right Controls */}
        <div style={{ display: "flex", alignItems: "center" }}>
          
          {/* Dark Mode */}
          <button
            style={styles.iconBtn}
            onClick={() => setDarkMode(!darkMode)}
          >
            {darkMode ? <FaSun /> : <FaMoon />}
          </button>

          {/* Hamburger */}
          <button
            style={styles.hamburger}
            onClick={() => setIsOpen(!isOpen)}
          >
            {isOpen ? <FaTimes /> : <FaBars />}
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      <div
        style={{
          ...styles.mobileMenu,
          transform: isOpen ? "translateY(0)" : "translateY(-120%)",
          ...(darkMode ? { background: "rgba(20,20,20,0.95)" } : {})
        }}
      >
        {navItems.map((item) => (
          <Link
            key={item.path}
            to={item.path}
            style={styles.mobileLink}
            onClick={() => setIsOpen(false)}
          >
            {item.label}
          </Link>
        ))}
      </div>
    </header>
  );
};

const navItems = [
  { label: "Home", path: "/" },
  { label: "About Us", path: "/about" },
  { label: "Services", path: "/services" },
  { label: "Careers", path: "/careers" },
  { label: "Contact Us", path: "/contact" },
  { label: "Admin", path: "/AdminDashboard" }
];

const styles = {
  header: {
    position: "fixed",
    top: 0,
    width: "100%",
    backdropFilter: "blur(15px)",
    background: "rgba(255,255,255,0.8)",
    transition: "0.3s",
    zIndex: 1000,
  },

  sticky: {
    boxShadow: "0 4px 20px rgba(0,0,0,0.15)",
  },

  dark: {
    background: "rgba(20,20,20,0.9)",
    color: "white",
  },

  container: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "15px 20px",
  },

  desktopNav: {
    display: window.innerWidth > 768 ? "flex" : "none",
    gap: "25px",
  },

  link: {
    textDecoration: "none",
    color: "inherit",
    fontWeight: 500,
    transition: "0.3s",
  },

  active: {
    color: "#0d6efd",
    fontWeight: "bold",
  },

  iconBtn: {
    background: "none",
    border: "none",
    fontSize: "18px",
    cursor: "pointer",
    marginRight: "10px",
  },

  hamburger: {
    display: window.innerWidth <= 768 ? "block" : "none",
    background: "none",
    border: "none",
    fontSize: "22px",
    cursor: "pointer",
  },

  mobileMenu: {
    display: window.innerWidth <= 768 ? "flex" : "none",
    flexDirection: "column",
    position: "absolute",
    width: "100%",
    top: "80px",
    left: 0,
    background: "rgba(255,255,255,0.95)",
    backdropFilter: "blur(15px)",
    transition: "0.4s ease",
  },

  mobileLink: {
    padding: "15px",
    textDecoration: "none",
    color: "inherit",
    borderBottom: "1px solid rgba(0,0,0,0.1)",
  },
};

export default InnerHeader;
